import React, { Component } from 'react';
import MScheduler from './MScheduler'

class MReview extends Component {
    render() {
        return (
            <div>
                <div>
                    <h1> Review selected Challenges and Activities! </h1> 
                </div>
                <div className="printReview">
                    <div className="printSelChallenges">
                        <h3> Selected Challenges</h3>
                        {this.props.challenge.map((itemInTheList,i)=>{
                        return (itemInTheList.isSelected && (!itemInTheList.isMandatory))? (<label className="labels">
                        <input
                            name="isChallenge"
                            type="checkbox"
                            checked={true}
                            onChange={()=>this.statusUnSelected(itemInTheList,i)}
                        > 
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.name}>
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.priority}>
                        </input>
                    </label>):'';

                        //itemInTheList.name, itemInTheList. ;

                        }
                        )

                        }
                    </div>
                    <div className="printSelActivities">
                {/*<label className="labels">
                        <p> </p>
                        <p>Acitvity</p>
                        <p>Duration</p>
                        <p>Daily/Weekly</p>
                        <p>Mandatory</p>
            </label>*/}
                        {this.props.activity.map((itemInTheList,i)=>{
                        return itemInTheList.isSelected? (<label className="labels">
                        <input
                            name="isAct"
                            type="checkbox"
                            checked={true}
                            onChange={()=>this.statusUnSelected(itemInTheList,i)}
                        > 
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.name}>
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.duration}>
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.isDailyTask}>
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.isMandatory}>
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.priority}>
                        </input>
                        <input
                            className="labelText"
                            type="textbox"
                            readOnly={true}
                            value={itemInTheList.isSelected }>
                        </input>
                    </label>):'';

                        //itemInTheList.name, itemInTheList. ;

                        }
                        )

                        }
                    </div>
                </div>
            </div>
        );
    }
}

export default MReview;
